import React from "react";

import "./Avatar.css";

interface AvatarProps {
  className: string;
  image: string;
  alt: string;
  width: number;
}

const Avatar: React.FC<AvatarProps> = (props) => {
  return (
    <div className={`avatar ${props.className}`}>
      <img
        src={props.image}
        alt={props.alt}
        style={{ width: props.width, height: props.width }}
      />
    </div>
  );
};

export default Avatar;
